description:
En kustbevakningsamiral som ar ankling traffar en anka som arbetar 
med att designa handvaskor. De foralskar sig i varandra och gifter sig, 
vilket inte direkt uppskattas av hennes 10 och hans 8 barn. Nar deras 
tva familjer mots blir kulturkrocken total.

Med Dennis Quaid, Rene Russo, Sean Faris m fl.
